   async fn main() {
       let api_key = env::var("ELEVEN_LABS_API_KEY").expect("ELEVEN_LABS_API_KEY must be set");
       let clipboard = ClipboardProvider::new().unwrap();
       let text = clipboard.get_contents().unwrap();

