5. Set the `ELEVEN_LABS_API_KEY` environment variable:
   Set the `ELEVEN_LABS_API_KEY` environment variable with your Eleven Labs API key.

6. Build and run the application:
   Run the following command to build and run the application:

   ```
   cargo run
   ```

