import React, { useContext, useState } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = ({ children, placement = 'bottom', content }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);
  const [isOpen, setIsOpen] = useState(false);

  const handleMouseEnter = () => {
    if (!tooltip) {
      setIsOpen(true);
    }
  };

  const handleMouseLeave = () => {
    if (tooltip !== content) {
      setIsOpen(false);
    }
    closeTooltip();
  };

  return (
    <>
      {React.cloneElement(children, {
        onMouseEnter: handleMouseEnter,
        onMouseLeave: handleMouseLeave,
      })}
      {isOpen && (
        <div
          className={`tooltip ${placement}`}
          style={{ top: `${children.getBoundingClientRect().bottom + 10}px`, left: `${children.getBoundingClientRect().left}px` }}
        >
          {content}
        </div>
      )}
    </>
  );
};

export default Tooltip;
```

